function parseSite (site) {
  Object.keys(site).forEach(function (url) {
    var page = site[url];
    if (page.children) {
      Object.keys(page.children).forEach(function (url) {
        var child = page.children[url];
        var match = site[child.url];
        if (match) {
          if (match.title !== child.title)
          console.log(child.url + ' on ' + page.url, match.title + ' vs ' + child.title);
        } else {
          if (page.url === 'indexn.html'
              || page.url === 'index.html'
              || page.url === 'themovie.html'
              || page.url === 'themovien.html'
              || child.url === 'index.html'
              || child.url === 'indexn.html'
              || child.title === 'Nederlands'
              || child.title === 'English') {
            // ignore
          } else {
            console.log('No match (on '+ page.url +') for', child.title, ':', child.url)
          }
        }
      });
    } else {
      console.log('--> Outbound link to: ' + page.url);
    }
  });
}

