function gatherChildren (site) {
  var children = {};
  Object.keys(site).forEach(function (url) {
    var page = site[url];
    Object.keys(page.children || []).forEach(function (url) {
      if (children[url]) {
        children[url].push(page.url)
      } else {
        children[url] = [page.url];
      }
    });
  });
  return children;
}

function determineParents (children) {
  var parents = {};
  Object.keys(children).filter(function (url) {
    var parents = children[url];
    return parents.length === 1;
  }).forEach(function (url) {
    var parent = children[url][0];
    if (parents[parent]) {
      parents[parent].push(url)
    } else {
      parents[parent] = [url];
    }
  });
  return parents;
}

function hasXparents (children, count) {
  return Object.keys(children).filter(function (url) {
    var parents = children[url];
    return parents.length === count;
  });
}

